import React from 'react';
import styled from 'styled-components';

const BusinessesContainer = styled.div`
display: flex;
flex-direction: column;
align-items: center;
width: 600px;
`

const Businesses = (children) => {
    return(
        <BusinessesContainer>
            <h1>Businesses</h1>
            {children}
        </BusinessesContainer>
    ) 
}; 

export default Businesses;
